import React, { useState } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Input } from "@/components/ui/input";
import { Button } from "@/components/ui/button";

const SignupForm = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    contactNumber: "",
    address: "",
    password: ""
  });

  const handleChange = (field, value) => {
    setFormData({ ...formData, [field]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-50">
      <Card className="w-full max-w-xl p-8">
        <h2 className="text-3xl font-bold mb-4">Sign up</h2>
        <p className="mb-6 text-gray-600">Enter your details below to create your account and get started.</p>
        <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <Input placeholder="First Name" value={formData.firstName} onChange={(e) => handleChange("firstName", e.target.value)} />
          <Input placeholder="Last Name" value={formData.lastName} onChange={(e) => handleChange("lastName", e.target.value)} />
          <Input placeholder="example@gmail.com" value={formData.email} onChange={(e) => handleChange("email", e.target.value)} />
          <Input placeholder="Contact Number" value={formData.contactNumber} onChange={(e) => handleChange("contactNumber", e.target.value)} />
          <Input placeholder="Address" className="col-span-1 md:col-span-2" value={formData.address} onChange={(e) => handleChange("address", e.target.value)} />
          <Input type="password" placeholder="Password" className="col-span-1 md:col-span-2" value={formData.password} onChange={(e) => handleChange("password", e.target.value)} />
          <div className="col-span-1 md:col-span-2 flex justify-between mt-4">
            <Button type="button" variant="outline">Cancel</Button>
            <Button type="submit">Confirm</Button>
          </div>
        </form>
        <p className="mt-4 text-sm text-center">
          Already have an account? <a href="#" className="text-blue-600 underline">Login</a>
        </p>
      </Card>
    </div>
  );
};

export default SignupForm;
